import React, { Component } from 'react';

class App extends Component {
  state = { button: null };

  renderContent() {
    if (state == null) {
      return <p>No content</p>;
    }
  }

  render() {
    return (
      <div>
        <button>Home</button>
        <button>About</button>
        <button>Services</button>
        <button>Contact</button>
        <div>{this.renderContent}</div>
      </div>
    );
  }
}

export default App;
